export class PaletteSelector{getColor(e,r=!1){return r?this.getVariableValue(e):this.getColorVariable(e)}getColorVariable(e){return`var(--${this.getColorNumber(e)});`}getVariableValue(e){return e.substring(e.indexOf(":")+1)}getColorNumber(e){return e.substring(0,e.indexOf(":"))}}export default PaletteSelector;